INSERT INTO `books` (`id`, `titre`, `description`, `prix`, `image`, `stock`, `isbn`, `date_publication`, `nombre_pages`, `created_at`, `updated_at`) VALUES
(1, 'One Piece - Tome 1', 'Romance Dawn - Le début de l\'aventure de Monkey D. Luffy', 7.95, 'images/One_Piece_Tome_1_68ddb8ded33d1.jpg', 20, '978-2-7234-4567-8', '1997-12-24', 192, '2025-10-02 01:27:34', '2025-10-02 01:27:34'),
(2, 'One Piece - Tome 2', 'Buggy le Clown - La suite des aventures dans East Blue', 7.95, 'images/One_Piece_2.jpg', 20, '978-2-7234-4568-9', '1998-04-03', 192, '2025-10-01 19:02:15', '2025-10-01 19:02:15'),
(3, 'Naruto - Tome 1', 'Uzumaki Naruto - L\'histoire du ninja le plus imprévisible', 7.50, 'images/Naruto_1.jpg', 30, '978-2-8050-0234-5', '1999-09-21', 192, '2025-10-01 19:02:15', '2025-10-01 19:02:15'),
(4, 'My Hero Academia - Tome 1', 'Izuku Midoriya a 14 ans, il rêve depuis son enfance de devenir un super-héros. Il faut dire que dans le monde où il vit 80 % de la population dispose de super-pouvoirs appelé \"Alter\" et ce n\'est malheureusement pas son cas ! Toutefois, il est persévérant et doté d\'un sérieux sens du devoir.', 6.90, 'images/My_Hero_Academia_.jpg', 35, '978-2-5050-1234-6', '2014-07-07', 192, '2025-10-02 00:08:14', '2025-10-02 00:08:14'),
(8, 'That Time I Got Reincarnated as a Slime - Tome 1', 'Rimuru Tempest - Un employé de bureau réincarné en slime dans un autre monde', 7.20, 'images/Me_Slime_1_.jpg', 22, '978-2-8095-1234-0', '2015-10-30', 180, '2025-10-01 19:02:15', '2025-10-01 19:02:15'),
(12, 'Le cycle de la Fondation Tome 1 : La Fondation', 'En ce début de treizième millénaire, l\'Empire n\'a jamais été aussi puissant, aussi étendu à travers toute la galaxie. C\'est clans sa capitale, Trantor, que l\'éminent savant Hari Seldon invente la psychohistoire, une science nouvelle permettant de prédire l\'avenir. Grâce à elle, Seldon prévoit l\'effondrement de l\'Empire d\'ici trois siècles, suivi d\'une ère de ténèbres de trente mille ans. Réduire cette période à mille ans est peut-être possible, à condition de mener à terme son projet : la Fondation, chargée de rassembler toutes les connaissances humaines. Une entreprise visionnaire qui rencontre de nombreux et puissants détracteurs... Récompensé par le prix Hugo de la \"meilleure série de science-fiction de tous les temps Le cycle de Fondation est l\'œuvre socle de la S-F moderne, celle que tous les amateurs du genre ont lue ou liront un jour.', 8.74, 'images/Fondation_68ddc0bad27c8.jpg', 20, '2070360539', '2009-03-26', 251, '2025-10-02 02:00:58', '2025-10-02 02:00:58'),
(13, 'La fraternité de l\'anneau: Le seigneur des anneaux Tome 1', 'Depuis sa publication en 1954-1955, le récit des aventures de Frodo et de ses compagnons, traversant la Terre du Milieu au péril de leur vie pour détruire l\'Anneau forgé par Sauron, a enchanté des dizaines de millions de lecteurs, de tous les âges. Chef-d\'œuvre de la fantasy, découverte d\'un monde imaginaire, de sa géographie, de son histoire et de ses langues, mais aussi réflexion sur le pouvoir et la mort, Le Seigneur des Anneaux est sans équivalent par sa puissance d\'évocation, son souffle et son ampleur. Cette nouvelle traduction prend en compte la dernière version du texte anglais, les indications laissées par Tolkien à l\'intention des traducteurs et les découvertes permises par les publications posthumes proposées par Christopher Tolkien. Ce volume contient 18 illustrations d\'Alan Lee, entièrement re-numérisées, d\'une qualité inégalée, ainsi que deux cartes (en couleur) de la Terre du Milieu et du Comté.', 9.60, 'images/SDA__68ddc2c7a1dae.jpg', 10, '2267027003', '2014-10-02', 528, '2025-10-02 02:09:43', '2025-10-02 02:09:43');

